import React, { useState } from "react";

const Login = () => {
  return (
    <div class="bg-principal-color h-screen flex items-center justify-center">
      <div class="h-96 w-80">
        <img src="https://wallha.com/download/ws/13/fotYTdx4-wallha.com.jpg" alt="" />
      </div>

      <div class="h-96 w-80 bg-white flex items-center flex flex-col items-center">
        <p class="text-sm mt-4">ProVision</p>
        <p class="text-3xl font-serif mt-2">Bienvenido de Nuevo</p>
        <img className="h-14 w-14 mt-2 rounded-full border-b-2 border-black" src="https://thumbs.dreamstime.com/b/l%C3%ADnea-icono-del-negro-avatar-perfil-de-usuario-121102131.jpg" alt="User Avatar"/>

        <div class="flex flex-col space-y-2 mt-5">
          <p class="text-xs">USER</p>
            <input type="text" class="border-b-2 border-black w-44"/>
            <p class="text-xs">PASSWORD</p>
          <input type="text" class="border-b-2 border-black"/>
        </div>

        <div class="flex flex-row space-x-2 mt-4">
            <p class="text-xs">Remember me</p>
            <p class="text-xs">Forgot Password</p>
        </div>
      </div>

    </div>
  );
};

export default Login;
